import React from 'react';

function App() {
  return (
    <panes>
      <div className="pane top-pane">
        <h1>Hello world</h1>
      </div>
      <div className="App">
      <iframe title="output" sandbox="allow-scripts"/>
      </div>
    </panes>
  );
}

export default App;
